import React from 'react';
import * as ReactDOM from 'react-dom/client';
import './index.css';


function Header() {
  return (
    <header className='flex flex-col font-libre'>
      <div id = 'header-name' className='text-5xl'> Saakhi Singh </div>
      <div id = 'header-nav'>
      <nav >
        <ul>
          <li className='w-fit inline-block p-4'> <a href='#'> HOME </a> </li>
          <li className='w-fit inline-block p-4'> <a href='#'> INFO </a></li>
          <li className='w-fit inline-block p-4'> <a href='#'> RESUME </a> </li>
        </ul>
      </nav>
      </div>
    </header>
  );
}

function App() {
  return (
  <h1 className="w-full text-2xl font-bold justify-center"> in construction </h1>);
}

ReactDOM.createRoot(document.getElementById('root')).render(<App />);
ReactDOM.createRoot(document.getElementById('header')).render(<Header />);
